var handleDataTableCombine = function () {
        "use strict";
        0 !== $("#data-table").length && $("#data-table").DataTable({
            dom: "lBfrtip",
            buttons: ["copy", "csv", "excel", "pdf", "print"],
            responsive: !0,
            autoFill: !0,
            colReorder: !0,
            keys: !0,
            rowReorder: !0,
            select: !0
        })
    },
    PageDemo = function () {
        "use strict";
        return {
            init: function () {
                handleDataTableCombine()
            }
        }
    }();
